import "./UserModal.css";

const UserModal = ({ userInfo }) => {
  const renderModalContent = () => {
    const resArr = Object.entries(userInfo);
    return resArr;
  };

  return (
    <div className="modal">
      <div className="modal__body">{renderModalContent()}</div>
    </div>
  );
};

export default UserModal;

